AS

CREATE PROCEDURE [dbo].[spDonation_Get_Member]
	@MemberNumber nvarchar(50),
	@PageNumber INT,
	@Pagesize INT
AS

BEGIN SET NOCOUNT ON;
SELECT ROW_NUMBER() OVER (ORDER BY Confirmed DESC) AS Id, [Type], Amount, MemberNumber, DonationNumber, Received, Confirmed, ConfirmedBy FROM dbo.Donation WITH (NOLOCK) WHERE Confirmed != '01/01/2000' ORDER BY Confirmed DESC OFFSET (@PageNumber - 1) * @PageSize ROWS FETCH NEXT @PageSize ROWS ONLY;
END

CREATE PROCEDURE [dbo].[spDonation_GetAll_Confirmed]
    @PageNumber INT,
    @PageSize INT
AS

BEGIN SET NOCOUNT ON;
SELECT ROW_NUMBER() OVER (ORDER BY Received ASC) AS Id, [Type], Amount, MemberNumber, DonationNumber, CONVERT(varchar(10), Received, 103) AS Received, CONVERT(varchar(10), Confirmed, 103) AS Confirmed, ConfirmedBy FROM dbo.Donation WITH (NOLOCK) WHERE Confirmed = '01/01/2000' ORDER BY Confirmed ASC OFFSET (@PageNumber - 1) * @PageSize ROWS FETCH NEXT @PageSize ROWS ONLY;
END

